import { Col, Container, Nav, Row } from "react-bootstrap"

const Projects = () => {

    const projects = [
        {
            title: "1",
            description: "1",
            imgUrl: progImg1,
        },
        {
            title: "2",
            description: "2",
            imgUrl: progImg2,
        },
        {
            title: "3",
            description: "3",
            imgUrl: progImg3,
        },
        {
            title: "4",
            description: "4",
            imgUrl: progImg4,
        },
        {
            title: "5",
            description: "5",
            imgUrl: progImg5,
        },
        {
            title: "6",
            description: "6",
            imgUrl: progImg6,
        },
    ]

    return (
        <section className="project" id="project">
            <Container>
                <Row>
                    <Col>
                        <h2>My Projects</h2>
                        <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum is simply dummy text of the printing and typesetting industry. </p>
                        <Nav variant="pills" defaultActiveKey="/home"></Nav>
                        <Nav.Item>
                            <Nav.Link href="/home">Active</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey='link-1'>option2</Nav.Link>
                        </Nav.Item>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}

export default Projects
